import React, { useState, useEffect } from "react";

function Profile() {
  const [passengers, setPassengers] = useState({});
  const token = localStorage.getItem("jwt")
  const id= localStorage.getItem("passenger")
  console.log(token)
  useEffect(() => {
    fetch(`http://localhost:3000/passengers/${parseInt(id)}`, {
      method: "GET",
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
    .then((res) => res.json())
    .then((res) =>{
      console.log(res)
      setPassengers(res)
        })
}
, [])

  return (
    <div className="w-full h-screen flex flex-col justify-center items-center">
      <div className="w-4/5 text-2xl flex justify-center">Welcome {passengers.username}</div>
          <div className="w-4/5">
            <div>
              <label className="flex flex-col w-full">Username:</label>
              <input
                className="border rounded-md w-full p-2"
                value={passengers.username}
              />
            </div>
            <div>
              <label className="flex flex-col w-1/2">Email:</label>
              <input
                className="border rounded-md p-2 w-full"
                value={passengers.email}
              />
            </div>
            <div>
              <label className="flex flex-col w-full">phone Number:</label>
              <input
                className="border rounded-md p-2 w-full"
                value={passengers.p_number}
              />
            </div>
          </div>


      <div className="flex flex-row w-full justify-evenly p-8">
        <button className="bg-blue-400 px-3 hover:ease-in-out d text-2xl text-white rounded-md w-24">Update</button>
        <button className="bg-red-400 px-3 hover:ease-in-out d text-2xl text-white rounded-md w-24">Delete</button>
      </div>
    </div>
  );
}

export default Profile;
